import{_ as e,o,c as t,Q as a}from"./chunks/framework.6e0d310a.js";const n="/teamone/img/issues/connection_error.png",r="/teamone/img/issues/ssl_error.png",i="/teamone/img/issues/property_storage_qouta_limit_error.png",b=JSON.parse('{"title":"TeamOne","titleTemplate":"Issues","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Issues"},"headers":[],"relativePath":"doc/issues.md","filePath":"doc/issues.md"}'),s={name:"doc/issues.md"},l=a('<h2 id="connection-issue" tabindex="-1">Connection issue <a class="header-anchor" href="#connection-issue" aria-label="Permalink to &quot;Connection issue&quot;">​</a></h2><p><img src="'+n+'" alt="img" data-zoomable=""></p><p>If you get <em>TeamOne is having issues connecting to IBM PA</em>, try the following steps:</p><ul><li>check your VPN connection (if you are using one)</li><li>check <a href="https://status.succeedium.com/" target="_blank" rel="noreferrer">TeamOne status</a></li><li>click the <strong>CHECK</strong> connection button below and if you see an SSL warning (i.e. &quot;Your connection is not private&quot;, &quot;Your connection is not secure&quot;, etc.), you should configure a <a href="https://www.ibm.com/support/pages/node/886183" target="_blank" rel="noreferrer">custom SSL certificate</a> for your IBM PA server. You can temporarily accept the warning by clicking the <strong>Advanced</strong> button below and then <strong>Proceed</strong> to. After that you can go back to Google Sheets and re-open the TeamOne sidebar.</li></ul><p><img src="'+r+'" alt="img" data-zoomable=""></p><ul><li>Check your IBM PA (TM1) server is up</li><li>Are you using IBM PA hosted on AWS or elsewhere? Check the firewall rules and make sure the <strong>HTTPPortNumber</strong> port is open</li><li><a href="https://succeedium.com/teamone/contact" target="_blank" rel="noreferrer">Contact us</a></li></ul><h2 id="teamone-add-on-not-working-when-signed-in-with-multiple-accounts" tabindex="-1">TeamOne add-on not working when signed in with multiple accounts <a class="header-anchor" href="#teamone-add-on-not-working-when-signed-in-with-multiple-accounts" aria-label="Permalink to &quot;TeamOne add-on not working when signed in with multiple accounts&quot;">​</a></h2><p>Additionally you may see the following messages in Dev console:</p><ul><li>Exception: You do not have permission to access the requested document.</li><li>ERROR: Authorization is required to perform that action. (the error message can be different in different languages) There is a limitation of add-ons when using multiple accounts. It is documented here: <a href="https://developers.google.com/apps-script/guides/support/troubleshooting?hl=en#issues-multiple" target="_blank" rel="noreferrer">https://developers.google.com</a></li></ul><p>You can use one of the following workarounds:</p><ul><li>sign out from all accounts and sign in back first with the account you intend to use TeamOne add-on with</li><li>for Google Chrome, use a separate <a href="https://support.google.com/chrome/answer/2364824" target="_blank" rel="noreferrer">account profile</a></li><li>for Firefox, use a separate <a href="https://addons.mozilla.org/en-US/firefox/addon/multi-account-containers/" target="_blank" rel="noreferrer">account containers</a></li><li>use a different browser for TeamOne add-on</li><li>use a new incognito window</li></ul><p>We recommend using a separate Google Chrome profile (or Firefox account container) with your work email.</p><h2 id="teamone-add-on-not-working-permission-denied" tabindex="-1">TeamOne add-on not working. PERMISSION_DENIED <a class="header-anchor" href="#teamone-add-on-not-working-permission-denied" aria-label="Permalink to &quot;TeamOne add-on not working. PERMISSION_DENIED&quot;">​</a></h2><p>You may also see the next error in Dev console: <em>We&#39;re sorry, a server error occurred while reading from storage. Error code PERMISSION_DENIED.?</em> This is a random error when trying to access Google script functions. Try the following to resolve it:</p><ul><li>re-open TeamOne Sidebar</li><li>refresh page and try opening TeamOne Sidebar</li><li>relogin to your Google account, re-open your Google sheet and try opening TeamOne Sidebar</li></ul><h2 id="teamone-add-on-not-working-in-incognito-window" tabindex="-1">TeamOne add-on not working in incognito window <a class="header-anchor" href="#teamone-add-on-not-working-in-incognito-window" aria-label="Permalink to &quot;TeamOne add-on not working in incognito window&quot;">​</a></h2><p>You may also see the next error in Dev console: <em>Error in v-on handler: &quot;SecurityError: Failed to read the &#39;localStorage&#39; property from &#39;Window&#39;: Access is denied for this document.&quot;</em> TeamOne add-on is using cookies and it may be blocked by your browser, for instance under Chrome&#39;s Settings &gt; Privacy &gt; Content settings, you have the cookie setting set to &quot;Block sites from setting any data&quot;. Enable cookies and try again.</p><h2 id="teamone-formula-returns-unknown-function-error" tabindex="-1">=TEAMONE() formula returns &quot;unknown function&quot; error <a class="header-anchor" href="#teamone-formula-returns-unknown-function-error" aria-label="Permalink to &quot;=TEAMONE() formula returns &quot;unknown function&quot; error&quot;">​</a></h2><p>Make sure you opened the TeamOne sidebar, it will load all the add-on scripts including the <em><strong>TEAMONE()</strong></em> function.</p><p>In some cases (like when you copy an existing sheet document), add-ons may require you to reactivate them. Try the next steps:</p><ol><li>Go to <em>Extensions &gt; TeamOne &gt; Help</em> menu</li><li>Click <em>View in store</em></li><li>Click the <em>Settings</em> icon at the top right and select <em>Manage Apps</em></li><li>Click the <em>Options</em> icon (3 vertical dots) on the TeamOne add-on card</li><li>Uncheck <em>Use in this document</em></li><li>Click the <em>Options</em> icon again and select <em>Use in this document</em></li><li>Close the marketplace screen</li><li>Refresh the page and try <em>TEAMONE recalculate</em> on the sidebar functions tab</li></ol><h2 id="resultsetoutofmemory-auditlogmaxquerymemory-too-small" tabindex="-1">ResultSetOutOfMemory: AuditLogMaxQueryMemory too small <a class="header-anchor" href="#resultsetoutofmemory-auditlogmaxquerymemory-too-small" aria-label="Permalink to &quot;ResultSetOutOfMemory: AuditLogMaxQueryMemory too small&quot;">​</a></h2><p>If you are getting <em><strong>ResultSetOutOfMemory: AuditLogMaxQueryMemory too small</strong></em> please make sure you have PA 2.0.9.17 or later</p><h2 id="property-storage-quota" tabindex="-1">Property storage quota <a class="header-anchor" href="#property-storage-quota" aria-label="Permalink to &quot;Property storage quota&quot;">​</a></h2><p>TeamOne stores all the settings, formulas and explorations using the <a href="https://developers.google.com/apps-script/guides/properties" target="_blank" rel="noreferrer">Google Properties Service</a>. This service has certain <a href="https://developers.google.com/apps-script/guides/services/quotas#current_limitations" target="_blank" rel="noreferrer">quotas</a>, in particular, 500 KB for storage per document and will receive the next error if exceeding this limit: &quot;Exception: You have exceeded the property storage quota. Please remove some properties and try again. (line 66).&quot;</p><p><img src="'+i+'" alt="img" data-zoomable=""></p><p>See <a href="./content-manager.html#memory-usage">Memory usage</a> to troubleshoot and resolve this issue.</p><h2 id="invalid-username-or-password" tabindex="-1">Invalid username or password <a class="header-anchor" href="#invalid-username-or-password" aria-label="Permalink to &quot;Invalid username or password&quot;">​</a></h2><p>When entering your credentials, you may receive the &quot;Invalid username or password&quot; message in TeamOne if your username or password contains the following special characters:</p><ul><li>&quot;\\&quot; (backslash)</li><li>&quot;:&quot; (colon)</li></ul><p>You can either change your password or configure TeamOne to use SSO (Single-Sign-On) for your <a href="./index.html#using-ibm-sso">IBM PA Cloud</a> or <a href="./index.html#ibm-pa-local-connection">IBM PA Local</a> connection.</p><h2 id="stringcellupdateerror" tabindex="-1">StringCellUpdateError <a class="header-anchor" href="#stringcellupdateerror" aria-label="Permalink to &quot;StringCellUpdateError&quot;">​</a></h2><p>When uploading values to an IBM Planning Analytics cube measure element that has a defined picklist attribute, you may encounter a StringCellUpdateError. This error occurs if the value being uploaded does not match any of the allowed elements in the picklist.</p><div class="tip custom-block"><p class="custom-block-title">Picklist alias</p><p>If the picklist subset uses an alias, ensure that you upload the alias values from Google Sheets and not the principal names.</p></div><h2 id="exception-no-item-with-the-given-id-could-be-found-possibly-because-you-have-not-edited-this-item-or-do-not-have-permission-to-access-it" tabindex="-1">Exception: No item with the given ID could be found. Possibly because you have not edited this item or do not have permission to access it. <a class="header-anchor" href="#exception-no-item-with-the-given-id-could-be-found-possibly-because-you-have-not-edited-this-item-or-do-not-have-permission-to-access-it" aria-label="Permalink to &quot;Exception: No item with the given ID could be found. Possibly because you have not edited this item or do not have permission to access it.&quot;">​</a></h2><p>This error may occur in a document where the TeamOne add-on was first <em><strong>initialized</strong></em> by an account that has since been deleted or disabled. When a user opens a Google Sheets add-on in a new document for the first time, they grant the necessary permissions (&quot;authorize&quot;) for it to perform actions such as accessing the document. Once authorized, the add-on continues using that person’s credentials, even for scheduled or automated actions. If the account that originally authorized the add-on is disabled or deleted, the add-on can no longer use those credentials and you may get this error. If this is not the case, please contact us at <a href="mailto:teamone@succeedium.com" target="_blank" rel="noreferrer">teamone@succeedium.com</a> through the <a href="https://succeedium.atlassian.net/servicedesk/customer/portals" target="_blank" rel="noreferrer">TeamOne support desk</a>.</p><div class="tip custom-block"><p class="custom-block-title">Copying the Document</p><p>Use <strong>File &gt; Make a copy</strong> to create a duplicate of the current document. This will retain all TeamOne formulas, but you will need to recalculate them. You can <a href="./functions.html#recalculate-all">Recalculate all</a> sheets at once from the TeamOne Sidebar menu.</p></div>',37),u=[l];function c(d,m,h,p,g,f){return o(),t("div",null,u)}const w=e(s,[["render",c]]);export{b as __pageData,w as default};
